peration as UpdateEnrichments, but // accepting an iterator function. UpdateEnrichmentsIter(ctx context.Context, kind string, fingerprint driver.Fingerprint, enIter EnrichmentIter) (uuid.UUID, error) } EnrichmentUpdater is an interface exporting the necessary methods for storing and querying Enrichments. package datastore // import \"github.com/quay/claircore/datastore\" type MatcherStore interface { Updater Vulnerability Enrichment } MatcherStore aggregates all interface types package datastore // import \"github.com/quay/claircore/datastore\" type Updater interface { EnrichmentUpdater // UpdateVulnerabilities creates a new UpdateOperation, inserts the provided // vulnerabilities, and ensures vulnerabilities from previous updates are // not queried by clients. UpdateVulnerabilities(ctx context.Context, updater string, fingerprint driver.Fingerprint, vulns []*claircore.Vulnerability) (uuid.UUID, error) // UpdateVulnerabilitiesIter performs the same operation as // UpdateVulnerabilities, but accepting an iterator function. UpdateVulnerabilitiesIter(ctx context.Context, updater string, fingerprint driver.Fingerprint, vulnIter VulnerabilityIter) (uuid.UUID, error) // DeltaUpdateVulnerabilities creates a new UpdateOperation consisting of existing // vulnerabilities and new vulnerabilities. It also takes an array of deleted // vulnerability names which should no longer be available to query. DeltaUpdateVulnerabilities(ctx context.Context, updater string, fingerprint driver.Fingerprint, vulns []*claircore.Vulnerability, deletedVulns []string) (uuid.UUID, error) // GetUpdateOperations returns a list of UpdateOperations in date descending // order for the given updaters. // // The returned map is keyed by Updater implementation's unique names. // // If no updaters are specified, all UpdateOperations are returned. GetUpdateOperations(context.Context, driver.UpdateKind, ...string) (map[string][]driver.UpdateOperation, error) // GetLatestUpdateRefs reports the latest update reference for every known // updater. GetLatestUpdateRefs(context.Context, driver.UpdateKind) (map[string][]driver.UpdateOperation, error) // GetLatestUpdateRef reports the latest update reference of any known // updater. GetLatestUpdateRef(context.Context, driver.UpdateKind) (uuid.UUID, error) // DeleteUpdateOperations removes an UpdateOperation. // A call to GC must be run after this to garbage collect vulnerabilities associated // with the UpdateOperation. // // The number of UpdateOperations deleted is returned. DeleteUpdateOperations(context.Context, ...uuid.UUID) (int64, error) // GetUpdateOperationDiff reports the UpdateDiff of the two referenced // Operations. // // In diff(1) terms, this is like // //\tdiff prev cur // GetUpdateDiff(ctx context.Context, prev, cur uuid.UUID) (*driver.UpdateDiff, error) // GC will delete any update operations for an updater which exceeds the provided keep // value. // // Implementations may throttle the GC process for datastore efficiency reasons. // // The returned int64 value indicates the remaining number of update operations needing GC. // Running this method till the returned value is 0 accomplishes a full GC of the vulnstore. GC(ctx context.Context, keep int) (int64, error) // Initialized reports whether the vulnstore contains vulnerabilities. Initialized(context.Context) (bool, error) // RecordUpdaterStatus records that an updater is up to date with vulnerabilities at this time RecordUpdaterStatus(ctx context.Context, updaterName string, updateTime time.Time, fingerprint driver.Fingerprint, updaterError error) error // RecordUpdaterSetStatus records that all updaters from an updater set are up to date with vulnerabilities at this time RecordUpdaterSetStatus(ctx context.Context, updaterSet string, updateTime time.Time) error\n} Updater is an interface exporting the necessary methods for updating a vulnerability database. package datastore // import \"github.com/quay/claircore/datastore\" type EnrichmentUpdater interface { // UpdateEnrichments creates a new EnrichmentUpdateOperation, inserts the provided // EnrichmentRecord(s), and ensures enrichments from previous updates are not // queries by clients. UpdateEnrichments(ctx context.Context, kind string, fingerprint driver.Fingerprint, enrichments []driver.EnrichmentRecord) (uuid.UUID, error) // UpdateEnrichmentsIter performs the same operation as UpdateEnrichments, but // accepting an iterator function. UpdateEnrichmentsIter(ctx context.Context, kind string, fingerprint driver.Fingerprint, enIter EnrichmentIter) (uuid.UUID, error) } EnrichmentUpdater is an interface exporting the necessary methods for storing and querying Enrichments. package datastore // import \"github.com/quay/claircore/datastore\" type Vulnerability interface { // Get finds the vulnerabilities which match each package provided in the // [IndexRecord]s. This may be a one-to-many relationship. A map of Package // ID to Vulnerabilities is returned. Get(ctx context.Context, records []*claircore.IndexRecord, opts GetOpts) (map[string][]*claircore.Vulnerability, error)\n} Vulnerability is the interface for querying stored Vulnerabilities.\n```\n```\npackage datastore // import \"github.com/quay/claircore/datastore\" type MatcherStore interface { Updater Vulnerability Enrichment\n} MatcherStore aggregates all interface types package datastore // import \"github.com/quay/claircore/datastore\" type Updater interface { EnrichmentUpdater // UpdateVulnerabilities creates a new UpdateOperation, inserts the provided\n// vulnerabilities, and ensures vulnerabilities from previous updates are\n// not queried by clients.\nUpdateVulnerabilities(ctx context.Context, updater string, fingerprint driver.Fingerprint, vulns []*claircore.Vulnerability) (uuid.UUID, error)\n// UpdateVulnerabilitiesIter performs the same operation as\n// UpdateVulnerabilities, but accepting an iterator function.\nUpdateVulnerabilitiesIter(ctx context.Context, updater string, fingerprint driver.Fingerprint, vulnIter VulnerabilityIter) (uuid.UUID, error)\n// DeltaUpdateVulnerabilities creates a new UpdateOperation consisting of existing\n// vulnerabilities and new vulnerabilities. It also takes an array of deleted\n// vulnerability names which should no longer be available to query.\nDeltaUpdateVulnerabilities(ctx context.Context, updater string, fingerprint driver.Fingerprint, vulns []*claircore.Vulnerability, deletedVulns []string) (uuid.UUID, error)\n// GetUpdateOperations returns a list of UpdateOperations in date descending\n// order for the given updaters.\n//\n// The returned map is keyed by Updater implementation's unique names.\n//\n// If no updaters are specified, all UpdateOperations are returned.\nGetUpdateOperations(context.Context, driver.UpdateKind, ...string) (map[string][]driver.UpdateOperation, error)\n// GetLatestUpdateRefs reports the latest update reference for every known\n// updater.\nGetLatestUpdateRefs(context.Context, driver.UpdateKind) (map[string][]driver.UpdateOperation, error)\n// GetLatestUpdateRef reports the latest update reference of any known\n// updater.\nGetLatestUpdateRef(context.Context, driver.UpdateKind) (uuid.UUID, error)\n// DeleteUpdateOperations removes an UpdateOperation.\n// A call to GC must be run after this to garbage collect vulnerabilities associated\n// with the UpdateOperation.\n//\n// The number of UpdateOperations deleted is returned.\nDeleteUpdateOperations(context.Context, ...uuid.UUID) (int64, error)\n// GetUpdateOperationDiff reports the UpdateDiff of the two referenced\n// Operations.\n//\n// In diff(1) terms, this is like\n//\n//\tdiff prev cur\n//\nGetUpdateDiff(ctx context.Context, prev, cur uuid.UUID) (*driver.UpdateDiff, error)\n// GC will delete any update operations for an updater which exceeds the provided keep\n// value.\n//\n// Implementations may throttle the GC process for datastore efficiency reasons.\n//\n// The returned int64 value indicates the remaining number of update operations needing GC.\n// Running this method till the returned value is 0 accomplishes a full GC of the vulnstore.\nGC(ctx context.Context, keep int) (int64, error)\n// Initialized reports whether the vulnstore contains vulnerabilities.\nInitialized(context.Context) (bool, error)\n// RecordUpdaterStatus records that an updater is up to date with vulnerabilities at this time\nRecordUpdaterStatus(ctx context.Context, updaterName string, updateTime time.Time, fingerprint driver.Fingerprint, updaterError error) error\n// RecordUpdaterSetStatus records that all updaters from an updater set are up to date with vulnerabilities at this time\nRecordUpdaterSetStatus(ctx context.Context, updaterSet string, updateTime time.Time) error } Updater is an interface exporting the necessary methods for updating a vulnerability database. package datastore // import \"github.com/quay/claircore/datastore\" type EnrichmentUpdater interface { // UpdateEnrichments creates a new EnrichmentUpdateOperation, inserts the provided // EnrichmentRecord(s), and ensures enrichments from previous updates are not // queries by clients. UpdateEnrichments(ctx context.Context, kind string, fingerprint driver.Fingerprint, enrichments []driver.EnrichmentRecord) (uuid.UUID, error) // UpdateEnrichmentsIter performs the same operation as UpdateEnrichments, but // accepting an iterator function. UpdateEnrichmentsIter(ctx context.Context, kind string, fingerprint driver.Fingerprint, enIter EnrichmentIter) (uuid.UUID, error)\n} EnrichmentUpdater is an interface exporting the necessary methods for storing and querying Enrichments. package datastore // import \"github.com/quay/claircore/datastore\" type Vulnerability interface { // Get finds the vulnerabilities which match each package provided in the // [IndexRecord]s. This may be a one-to-many relationship. A map of Package // ID to Vulnerabilities is returned. Get(ctx context.Context, records []*claircore.IndexRecord, opts GetOpts) (map[string][]*claircore.Vulnerability, error) } Vulnerability is the interface for querying stored Vulnerabilities. package datastore // import \"github.com/quay/claircore/datastore\" type Enrichment interface { GetEnrichment(ctx context.Context, kind string, tags []string) ([]driver.EnrichmentRecord, error)\n} Enrichment is an interface for querying enrichments from the store.\n```","breadcrumbs":"Reference » Matcher Store » Matcher Store","id":"55","title":"Matcher Store"},"56":{"body":"A Manifest is analogous to an OCI Image Manifest : it defines the order of layers and how to retrieve the them. package claircore // import \"github.com/quay/claircore\" type Manifest struct { // content addressable hash. should be able to be computed via // the hashes of all included layers Hash Digest `json:\"hash\"` // an array of filesystem layers indexed in the same order as the corresponding image Layers []*Layer `json:\"layers\"`\n} Manifest represents a docker image. Layers array MUST be indexed in the order that image layers are stacked.","breadcrumbs":"Reference » Manifest » Manifest","id":"56","title":"Manifest"},"57":{"body":"A Matcher performs the heavy lifting of matching manifest contents to relevant vulnerabilities. These implementations provide the smarts for understanding if a particular artifact in a layer is vulnerable to a particular advisory in the database. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Matcher interface { // a unique name for the matcher Name() string // Filter informs the Controller if the implemented Matcher is interested in the provided IndexRecord. Filter(record *claircore.IndexRecord) bool // Query informs the Controller how it should match packages with vulnerabilities. // All conditions are logical AND'd together. Query() []MatchConstraint // Vulnerable informs the Controller if the given package is affected by the given vulnerability. // for example checking the \"FixedInVersion\" field. Vulnerable(ctx context.Context, record *claircore.IndexRecord, vuln *claircore.Vulnerability) (bool, error)\n} Matcher is an interface which a Controller uses to query the vulnstore for vulnerabilities. The Filter method is used to inform Libvuln the provided artifact is interesting. The Query method tells Libvuln how to query the security advisory database. The Vulnerable method reports whether the provided package is vulnerable to the provided vulnerability. Typically, this would perform a version check between the artifact and the vulnerability in question.","breadcrumbs":"Reference » Matcher » Matcher","id":"57","title":"Matcher"},"58":{"body":"A Package Scanner should discover any packages found within the given layer. It is OK for to discover no packages within a layer. package indexer // import \"github.com/quay/claircore/indexer\" type PackageScanner interface { VersionedScanner // Scan performs a package scan on the given layer and returns all // the found packages Scan(context.Context, *claircore.Layer) ([]*claircore.Package, error)\n} PackageScanner provides an interface for unique identification or a PackageScanner and a Scan method for extracting installed packages from an individual container layer func NewPackageScannerMock(name, version, kind string) PackageScanner","breadcrumbs":"Reference » Package Scanner » Package Scanner","id":"58","title":"Package Scanner"},"59":{"body":"RemoteMatcher is an additional interface a Matcher may implement to skip the database for matching results and use an external API. package driver // import \"github.com/quay/claircore/libvuln/driver\" type RemoteMatcher interface { QueryRemoteMatcher(ctx context.Context, records []*claircore.IndexRecord) (map[string][]*claircore.Vulnerability, error)\n} RemoteMatcher is an additional interface that a Matcher can implement. When called the interface can invoke the remote matcher using an HTTP API to fetch new vulnerabilities associated with the given IndexRecords. The information retrieved from this interface won't be persisted into the claircore database.","breadcrumbs":"Reference » Remote Scanner » RemoteMatcher","id":"59","title":"RemoteMatcher"},"6":{"body":"Indexing is the process of submitting a manifest to Libindex, fetching the manifest's layers, indexing their contents, and coalescing a final Index Report. Coalescing is the act of computing a final set of contents (packages, distributions, repos) from a set of layers. Since layers maybe shared between many manifests, the final contents of a manifest must be computed. To perform an Index you must provide a claircore.Manifest data struture to the Index method. The Manifest data structure describes an image manifest's layers and where they can be fetched from. m := new(claircore.Manifest) // Populate somehow ... ir, err := lib.Index(ctx, m) if err != nil { panic(err) } The Index method will block until an claircore.IndexReport is returned. The context should be bound to some valid lifetime such as a request. As the Indexer works on the manifest it will update its database throughout the process. You may view the status of an index report via the \"IndexReport\" method. ir, ok, err := lib.IndexReport(ctx, m.Hash) if err != nil { panic(err) } Libindex performs its work incrementally and saves state as it goes along. If Libindex encounters an intermittent error during the index (for example, due to network failure while fetching a layer), when the manifest is resubmitted only the layers not yet indexed will be fetched and processed.","breadcrumbs":"Getting Started » Libindex Usage » Indexing","id":"6","title":"Indexing"},"60":{"body":"A RepositoryScanner should identify any repositories discovered in the provided layer. It is OK for the scanner to identify no repositories. package indexer // import \"github.com/quay/claircore/indexer\" type RepositoryScanner interface { VersionedScanner Scan(context.Context, *claircore.Layer) ([]*claircore.Repository, error)\n}","breadcrumbs":"Reference » Repository Scanner » Repository Scanner","id":"60","title":"Repository Scanner"},"61":{"body":"A Resolver is used to analyze and modify the post-coalesced index report. This is useful for operations that need all context from an index report. package indexer // import \"github.com/quay/claircore/indexer\" type Resolver interface { Resolve(context.Context, *claircore.IndexReport, []*claircore.Layer) *claircore.IndexReport\n} Resolver is used for any reasoning that needs to be done with all the layers in context. Resolvers are called at the end of the coalesce step when reports from separate scanners are merged. Any Resolvers' Resolve() methods are called (in no set order) at the end of the coalesce step after reports from separate scanners are merged.","breadcrumbs":"Reference » Resolver » Resolver","id":"61","title":"Resolver"},"62":{"body":"RPCScanner is an optional interface a Scanner may implement. When implemented, the scanner's Configure method will be called with a ConfigDeserializer function and an HTTP client. The Scanner may pass its config as an argument to the ConfigDeserializer function to populate the struct and use the HTTP client for any remote access necessary during the scanning process. package indexer // import \"github.com/quay/claircore/indexer\" type RPCScanner interface { Configure(context.Context, ConfigDeserializer, *http.Client) error\n} RPCScanner is an interface scanners can implement to receive configuration and denote that they expect to be able to talk to the network at run time. package indexer // import \"github.com/quay/claircore/indexer\" type RPCScanner interface { Configure(context.Context, ConfigDeserializer, *http.Client) error\n} RPCScanner is an interface scanners can implement to receive configuration and denote that they expect to be able to talk to the network at run time. package indexer // import \"github.com/quay/claircore/indexer\" type ConfigDeserializer func(interface{}) error ConfigDeserializer can be thought of as an Unmarshal function with the byte slice provided. This will typically be something like (*json.Decoder).Decode.","breadcrumbs":"Reference » RPC Scanner » RPCScanner","id":"62","title":"RPCScanner"},"63":{"body":"An Updater is responsible for performing run-time fetching and parsing of a security database. The returned vulnerabilities will be written to claircore's database and used in vulnerability matching. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Updater interface { Name() string Fetcher Parser\n} Updater is an aggregate interface combining the method set of a Fetcher and a Parser and forces a Name() to be provided package driver // import \"github.com/quay/claircore/libvuln/driver\" type Updater interface { Name() string Fetcher Parser\n} Updater is an aggregate interface combining the method set of a Fetcher and a Parser and forces a Name() to be provided package driver // import \"github.com/quay/claircore/libvuln/driver\" type Fetcher interface { Fetch(context.Context, Fingerprint) (io.ReadCloser, Fingerprint, error) } Fetcher is an interface which is embedded into the Updater interface. When called the interface should determine if new security advisory data\nis available. Fingerprint may be passed into in order for the Fetcher to\ndetermine if the contents has changed If there is new content Fetcher should return a io.ReadCloser where the new\ncontent can be read. Optionally a fingerprint can be returned which uniquely\nidentifies the new content. If the conent has not change an Unchanged error should be returned. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Updater interface { Name() string Fetcher Parser } Updater is an aggregate interface combining the method set of a Fetcher and a Parser and forces a Name() to be provided package driver // import \"github.com/quay/claircore/libvuln/driver\" type Fetcher interface { Fetch(context.Context, Fingerprint) (io.ReadCloser, Fingerprint, error)\n} Fetcher is an interface which is embedded into the Updater interface. When called the interface should determine if new security advisory data is available. Fingerprint may be passed into in order for the Fetcher to determine if the contents has changed If there is new content Fetcher should return a io.ReadCloser where the new content can be read. Optionally a fingerprint can be returned which uniquely identifies the new content. If the conent has not change an Unchanged error should be returned. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Parser interface { // Parse should take an io.ReadCloser, read the contents, parse the contents // into a list of claircore.Vulnerability structs and then return // the list. Parse should assume contents are uncompressed and ready for parsing. Parse(ctx context.Context, contents io.ReadCloser) ([]*claircore.Vulnerability, error) } Parser is an interface which is embedded into the Updater interface. Parse should be called with an io.ReadCloser struct where the contents\nof a security advisory database can be read and parsed into an array of\n*claircore.Vulnerability package driver // import \"github.com/quay/claircore/libvuln/driver\" type Updater interface { Name() string Fetcher Parser } Updater is an aggregate interface combining the method set of a Fetcher and a Parser and forces a Name() to be provided package driver // import \"github.com/quay/claircore/libvuln/driver\" type Fetcher interface { Fetch(context.Context, Fingerprint) (io.ReadCloser, Fingerprint, error)\n} Fetcher is an interface which is embedded into the Updater interface. When called the interface should determine if new security advisory data is available. Fingerprint may be passed into in order for the Fetcher to determine if the contents has changed If there is new content Fetcher should return a io.ReadCloser where the new content can be read. Optionally a fingerprint can be returned which uniquely identifies the new content. If the conent has not change an Unchanged error should be returned. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Parser interface { // Parse should take an io.ReadCloser, read the contents, parse the contents // into a list of claircore.Vulnerability structs and then return // the list. Parse should assume contents are uncompressed and ready for parsing. Parse(ctx context.Context, contents io.ReadCloser) ([]*claircore.Vulnerability, error) } Parser is an interface which is embedded into the Updater interface. Parse should be called with an io.ReadCloser struct where the contents\nof a security advisory database can be read and parsed into an array of\n*claircore.Vulnerability package driver // import \"github.com/quay/claircore/libvuln/driver\" type Fingerprint string Fingerprint is some identifying information about a vulnerability database.\n```\n```\npackage driver // import \"github.com/quay/claircore/libvuln/driver\" type Updater interface { Name() string Fetcher Parser\n} Updater is an aggregate interface combining the method set of a Fetcher and a Parser and forces a Name() to be provided package driver // import \"github.com/quay/claircore/libvuln/driver\" type Fetcher interface { Fetch(context.Context, Fingerprint) (io.ReadCloser, Fingerprint, error) } Fetcher is an interface which is embedded into the Updater interface. When called the interface should determine if new security advisory data\nis available. Fingerprint may be passed into in order for the Fetcher to\ndetermine if the contents has changed If there is new content Fetcher should return a io.ReadCloser where the new\ncontent can be read. Optionally a fingerprint can be returned which uniquely\nidentifies the new content. If the conent has not change an Unchanged error should be returned. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Parser interface { // Parse should take an io.ReadCloser, read the contents, parse the contents // into a list of claircore.Vulnerability structs and then return // the list. Parse should assume contents are uncompressed and ready for parsing. Parse(ctx context.Context, contents io.ReadCloser) ([]*claircore.Vulnerability, error)\n} Parser is an interface which is embedded into the Updater interface. Parse should be called with an io.ReadCloser struct where the contents of a security advisory database can be read and parsed into an array of *claircore.Vulnerability package driver // import \"github.com/quay/claircore/libvuln/driver\" type Fingerprint string Fingerprint is some identifying information about a vulnerability database. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Configurable interface { Configure(context.Context, ConfigUnmarshaler, *http.Client) error\n} Configurable is an interface that Updaters can implement to opt-in to having their configuration provided dynamically.\n```\n```\npackage driver // import \"github.com/quay/claircore/libvuln/driver\" type Updater interface { Name() string Fetcher Parser\n} Updater is an aggregate interface combining the method set of a Fetcher and a Parser and forces a Name() to be provided package driver // import \"github.com/quay/claircore/libvuln/driver\" type Fetcher interface { Fetch(context.Context, Fingerprint) (io.ReadCloser, Fingerprint, error) } Fetcher is an interface which is embedded into the Updater interface. When called the interface should determine if new security advisory data\nis available. Fingerprint may be passed into in order for the Fetcher to\ndetermine if the contents has changed If there is new content Fetcher should return a io.ReadCloser where the new\ncontent can be read. Optionally a fingerprint can be returned which uniquely\nidentifies the new content. If the conent has not change an Unchanged error should be returned. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Parser interface { // Parse should take an io.ReadCloser, read the contents, parse the contents // into a list of claircore.Vulnerability structs and then return // the list. Parse should assume contents are uncompressed and ready for parsing. Parse(ctx context.Context, contents io.ReadCloser) ([]*claircore.Vulnerability, error)\n} Parser is an interface which is embedded into the Updater interface. Parse should be called with an io.ReadCloser struct where the contents of a security advisory database can be read and parsed into an array of *claircore.Vulnerability package driver // import \"github.com/quay/claircore/libvuln/driver\" type Fingerprint string Fingerprint is some identifying information about a vulnerability database. package driver // import \"github.com/quay/claircore/libvuln/driver\" type Configurable interface { Configure(context.Context, ConfigUnmarshaler, *http.Client) error\n} Configurable is an interface that Updaters can implement to opt-in to having their configuration provided dynamically. package driver // import \"github.com/quay/claircore/libvuln/driver\" type ConfigUnmarshaler func(interface{}) error ConfigUnmarshaler can be thought of as an Unmarshal function with the byte slice provided, or a Decode function. The function should populate a passed struct with any configuration\ninformation.","breadcrumbs":"Reference » Updater » Updater","id":"63","title":"Updater"},"64":{"body":"An UpdaterSetFactory is a factory for runtime construction and configuration for Updaters. package driver // import \"github.com/quay/claircore/libvuln/driver\" type UpdaterSetFactory interface { UpdaterSet(context.Context) (UpdaterSet, error)\n} UpdaterSetFactory is used to construct updaters at run-time. func StaticSet(s UpdaterSet) UpdaterSetFactory package driver // import \"github.com/quay/claircore/libvuln/driver\" type UpdaterSetFactory interface { UpdaterSet(context.Context) (UpdaterSet, error)\n} UpdaterSetFactory is used to construct updaters at run-time. func StaticSet(s UpdaterSet) UpdaterSetFactory package driver // import \"github.com/quay/claircore/libvuln/driver\" type UpdaterSet struct { // Has unexported fields. } UpdaterSet holds a deduplicated set of updaters. func NewUpdaterSet() UpdaterSet func (s *UpdaterSet) Add(u Updater) error func (s *UpdaterSet) Merge(set UpdaterSet) error func (s *UpdaterSet) RegexFilter(regex string) error func (s *UpdaterSet) Updaters() []Updater","breadcrumbs":"Reference » Updater Set Factory » UpdaterSetFactory","id":"64","title":"UpdaterSetFactory"},"65":{"body":"VersionFilter is an additional interface a Matcher may implement. If implemented, Libvuln will attempt to use the database and the normalized version field of a package to filter vulnerabilities in the database. This is an opt-in optimization for when a package manager's version scheme can be normalized into a claircore.Version. package driver // import \"github.com/quay/claircore/libvuln/driver\" type VersionFilter interface { VersionFilter() // VersionAuthoritative reports whether the Matcher trusts the database-side // filtering to be authoritative. // // A Matcher may return false if it's using a versioning scheme that can't // be completely normalized into a claircore.Version. VersionAuthoritative() bool\n} VersionFilter is an additional interface that a Matcher can implement to opt-in to using normalized version information in database queries.","breadcrumbs":"Reference » Version Filter » VersionFilter","id":"65","title":"VersionFilter"},"66":{"body":"A versioned scanner is typically embedded into other scanner types. It drives claircore's ability to register and understand when updaters have been changed. Functions that want to work with a generic scanner type should use a VersionedScanner. Implementers of this interface must provide a unique name. Making changes to a scanner's implementation must return a new value from Version. Implementers must return the correct kind: one of \"package\", \"distribution\", or \"repository\" package indexer // import \"github.com/quay/claircore/indexer\" type VersionedScanner interface { // unique name of the distribution scanner. Name() string // version of this scanner. this information will be persisted with the scan. Version() string // the kind of scanner. currently only package is implemented Kind() string\n} VersionedScanner can be embedded into specific scanner types. This allows for methods and functions which only need to compare names and versions of scanners not to require each scanner type as an argument.","breadcrumbs":"Reference » Versioned Scanner » Versioned Scanner","id":"66","title":"Versioned Scanner"},"67":{"body":"A Vulnerability Report is a structure describing a specific manifest, its contents, and the vulnerabilities affecting its contents. package claircore // import \"github.com/quay/claircore\" type VulnerabilityReport struct { // the manifest hash this vulnerability report is describing Hash Digest `json:\"manifest_hash\"` // all discovered packages in this manifest keyed by package id Packages map[string]*Package `json:\"packages\"` // all discovered distributions in this manifest keyed by distribution id Distributions map[string]*Distribution `json:\"distributions\"` // all discovered repositories in this manifest keyed by repository id Repositories map[string]*Repository `json:\"repository\"` // a list of environment details a package was discovered in keyed by package id Environments map[string][]*Environment `json:\"environments\"` // all discovered vulnerabilities affecting this manifest Vulnerabilities map[string]*Vulnerability `json:\"vulnerabilities\"` // a lookup table associating package ids with 1 or more vulnerability ids. keyed by package id PackageVulnerabilities map[string][]string `json:\"package_vulnerabilities\"` // a map of enrichments keyed by a type. Enrichments map[string][]json.RawMessage `json:\"enrichments\"`\n} VulnerabilityReport provides a report of packages and their associated vulnerabilities. A Vulnerability Report is package focused. Unpacking a report is done by mapping the keys in the PackageVulnerabilities field to the data structures in other lookup maps. For example: for pkgID, vulnIDS := range report.PackageVulnerabilities { // get package data structure pkg := report.Packages[pkgID] for _, vulnID := range vulnIDS { vuln := report.Vulnerabilities[vulnID] fmt.Printf(\"package %+v affected by vuln %+v\", pkg, vuln) } }","breadcrumbs":"Reference » Vulnerability Report » Vulnerability Report","id":"67","title":"Vulnerability Report"},"68":{"body":"These topics cover helpful tips for contributing to Claircore. Local Development Logging Misc Tests","breadcrumbs":"Contributors » Contributors","id":"68","title":"Contributors"},"69":{"body":"The preferred workflow is to fork the quay/claircore repository, push a feature branch to the new fork, then open a pull request. All pull requests should be targeted to the main branch outside of exceptional circumstances.","breadcrumbs":"Contributors » Guidelines » How to contribute","id":"69","title":"How to contribute"},"7":{"body":"Libindex treats layers as content addressable. Once a layer identified by a particular hash is indexed its contents are definitively known. A request to re-index a known layer results in returning the previous successful response. This comes in handy when dealing with base layers. The Ubuntu base layer is seen very often across container registries. Treating this layer as content addressable precludes the need to fetch and index the layer every time Libindex encounters it in a manifest. There are times where re-indexing the same layer is necessary however. At the point where Libindex realizes a new version of a component has not indexed a layer being submitted it will perform the indexing operation. A client must notice that Libindex has updated one of its components and subsequently resubmit Manifests. The State endpoint is implemented for this reason. Clients may query the State endpoint to receive an opaque string acting as a cookie, identifying a unique state of Libindex. When a client sees this cookie change it should re-submit manifests to Libindex to obtain a new index report. state, err := lib.State(ctx) if err != nil { panic(err) } if state == prevState { // Nothing to do. return } // Otherwise, re-index manifest.","breadcrumbs":"Getting Started » Libindex Usage » State","id":"7","title":"State"},"70":{"body":"As many tests as possible should run with the standard go test invocations. Adding the special tag integration (e.g. go test -tags integration ./...) will also run \"integration\" tests. The project interprets \"integration\" tests to mean any test that would need external resources, such as: External web servers External network access Out-of-process databases Large test fixtures After at least one run with the integration tag, the tests should cache needed resources and run as many tests as possible. See also the test/integration package.","breadcrumbs":"Contributors » Guidelines » Testing","id":"70","title":"Testing"},"71":{"body":"The Pull Request (PR) is the unit of code review. Claircore's review flow treats a feature branch as a stack of patches to be applied. That is to say, the feature branch should be rebased onto the target branch and have well-organized commits. Merge commits are disallowed. If the author would prefer to not rewrite commit history while working through reviews, fixup commits are the suggested way to achieve that. As many requirements as possible are enforced by CI, like: Commits being signed off Commit messages having a properly formed subject Go modules being tidied Please use the \"draft\" option if the branch is not ready. Please enable the \"allow edits by maintainers\" option. The maintainers may rebase, push, and merge contributors' branches. This may necessitate doing a git reset <remote>/<branch> to update a local branch.","breadcrumbs":"Contributors » Guidelines » Pull Requests","id":"71","title":"Pull Requests"},"72":{"body":"Git commits should be formatted like \"subject: summary\" and avoid going over 80 characters per line. The \"subject\" is usually the package affected by the commit (like jar or rhel -- the relative path isn't needed) but sometimes a broader category (like docs, all, or cicd) is OK. All the helper scripts should handle the \"normal\" convention (origin is quay/claircore and fork is one's personal fork) and the \"British\" convention (origin is one's personal fork and upstream is quay/claircore). More detailed contributor documentation can be found in the project documentation .","breadcrumbs":"Contributors » Guidelines » Conventions","id":"72","title":"Conventions"},"73":{"body":"The claircore project has switched from a git log based changelog to a git notes based changelog. This has the benefit of making the changelog more human-friendly, as it can have prose describing changes now, but makes adding entries a bit more involved. A full understanding of git notes is helpful for working with the changelog, but not required. If the reader has worked with the notes feature before, the changelog entries are stored under the changelog ref. For other users, there are some helper scripts in .github/scripts. Git notes is a mechanism for storing additional information alongside commits without modifying the commits. It does this by creating a ref full of files named after the commits, with their contents being the notes. This scheme requires some special care and tooling -- see the documentation for more information.","breadcrumbs":"Contributors » Changelog » Basics of git notes","id":"73","title":"Basics of git notes"},"74":{"body":"The primary helper script is changelog-edit. It allows a user to sync down notes, edit an entry, or both. See the output of the h flag for more information. The other script of interest is changelog-render, which can be used to render out the changelog on demand, assuming the changelog notes have been pulled locally. The changelog-update script uses changelog-render to add to the CHANGELOG.md file in the repository root.","breadcrumbs":"Contributors » Changelog » Helper scripts","id":"74","title":"Helper scripts"},"75":{"body":"Broadly, changelog entries should be formatted like commit messages without any trailers. Entries are turned into list items, with the subject being the bullet point and the body of the entry being the \"body\" of the item, or hidden behind details elements when using HTML-enabled output. The entries are almost always rendered as markdown, so using minimal markdown is OK. Anything requiring excessive markdown is probably better served as documentation proper, rather than a changelog entry.","breadcrumbs":"Contributors » Changelog » Formatting","id":"75","title":"Formatting"},"76":{"body":"The Claircore project utilizes well structured commits to keep the history useful and help with release automation. We suggest signing off on your commits as well. A typical commit will take on the following structure: <scope>: <subject> <body>\nFixes #1\nPull Request #2 Signed-Off By: <email> The header of the commit is regexp checked before commit and your commit will be kicked back if it does not conform.","breadcrumbs":"Contributors » Commit Style » Commit Style","id":"76","title":"Commit Style"},"77":{"body":"This is the section of code this commit influences. You will often see scopes such as \"notifier\", \"auth\", \"chore\", \"cicd\".","breadcrumbs":"Contributors » Commit Style » Scope","id":"77","title":"Scope"},"78":{"body":"Subject is a short and concise summary of the change the commit is introducing. It should be a sentence fragment without starting capitalization and ending punctuation and limited to about 60 characters, to allow for the scope prefix and decoration in the git log.","breadcrumbs":"Contributors » Commit Style » Subject","id":"78","title":"Subject"},"79":{"body":"Body should be full of detail. Explain what this commit is doing and why it is necessary. You may include references to issues and pull requests as well.","breadcrumbs":"Contributors » Commit Style » Body","id":"79","title":"Body"},"8":{"body":"Libindex is capable of providing a client with all manifests affected by a set of vulnerabilities. This functionality is designed for use with a notification mechanism. var vulns []claircore.Vulnerability affected, err := lib.AffectedManifests(ctx, vulns) if err != nil { panic(err) } for manifest, vulns := range affected.VulnerableManifests { for _, vuln := range vulns { fmt.Printf(\"vuln affecting manifest %s: %+v\", manifest, vuln) } } The slice of vulnerabilities returned for each manifest hash will be sorted by claircore.NormalizedSeverity in \"most severe\" descending order.","breadcrumbs":"Getting Started » Libindex Usage » AffectedManifests","id":"8","title":"AffectedManifests"},"80":{"body":"A local development environment is implemented via docker-compose.","breadcrumbs":"Contributors » Local Development » Local Development","id":"80","title":"Local Development"},"81":{"body":"Several make targets are defined for working with the local development environment. claircore-db-up - creates just the claircore database useful for running integration tests without test servers\nclaircore-db-restart - destroys and recreates a fresh database. localhost:5434","breadcrumbs":"Contributors » Local Development » Usage","id":"81","title":"Usage"},"82":{"body":"Several make targets are defined for working with tests. integration - run the integration test suite. requires the claircore-db to be up. run `make clair-db-up` before this target\nunit - run the unit test suite.\nbench - runs the benchmarks\nintegration-v - runs the integration test suite with verbose\nunit-v - runs the unit test suite with verbose","breadcrumbs":"Contributors » Local Development » Tests","id":"82","title":"Tests"},"83":{"body":"All the logging in claircore is done with zerolog via context.Context values. The zlog package takes OpenTelemetry labels and attaches them to zerolog events. This allows for claircore's logging to be used consistently throughout all the packages without having unintended prints to stderr.","breadcrumbs":"Contributors » Logging » Logging","id":"83","title":"Logging"},"84":{"body":"","breadcrumbs":"Contributors » Logging » How to Log","id":"84","title":"How to Log"},"85":{"body":"In a function, use zlog to add key-value pairs of any relevant context: ctx = zlog.ContextWithValues(ctx, \"component\", \"Example.Logger\") Alternatively, the go.opentelemetry.io/otel/baggage package can be used for more explicit control around the baggage values.","breadcrumbs":"Contributors » Logging » Adding Context","id":"85","title":"Adding Context"},"86":{"body":"Constant Messages Zerolog emits lines when the Msg or Msgf methods are called. Project style is to not use Msgf. Any variable data should be set as key-value pairs on the Event object. For example, don't do this: zlog.Info(ctx).Msgf(\"done at: %v\", time.Now()) Do this instead: zlog.Info(ctx). Time(\"time\", time.Now()). Msgf(\"done\") Grammar When noting the change during a chunk of work, make sure that the log messages scan as visually similar. Usually, this means formatting messages into \"${process} ${event}\". For example: frob start\nfrob initialized\nfrob ready\nfrob success\nfrob done Is much easier to scan than: starting to frob\ninitialized frobber\nready for frobbing\ndid frob\ndone with frobing Don't log and return When handling an error, code should only log it if it does not propagate it. The code that ultimately handles the error is responsible for deciding what to do with it. Logging and returning ends up with the same message repeated multiple times in the logs. Levels Claircore attempts to have consistent leveled logging. The rules for figuring out what level to use is: Panic There's some occurrence that means the process won't work correctly. Fatal Unused, because it prevents defers from running. Error Something unexpected occurred and the process can continue, but a human needs to be notified. An error will be returned for this request. Warn Something unexpected occurred and the process can continue. An error will be returned for this request. Info Some information that may be useful to an operator. Examples include a timer-based process starting and ending, a user request starting and ending, or a summary of work done. Debug Some information that may be useful to a developer. Examples include entering and exiting functions, stepping through a function, or specific file paths used while work is being done.","breadcrumbs":"Contributors » Logging » Logging style","id":"86","title":"Logging style"},"87":{"body":"Here's various codebase conventions that don't have dedicated pages: URLs URLs in code should be annotated with a //doc:url directive comment. See the the internal/cmd/mdbook-injecturls command for documentation on how the preprocessor works. The list of keywords isn't an allowlist, so an invocation like the following should list the ones actually used in the documentation using a command like git grep injecturls -- :/docs/*.md.","breadcrumbs":"Contributors » Misc","id":"87","title":"Contributors"},"88":{"body":"Tests in the claircore module may use various helpers underneath the test directory. Using these packages outside of testing code is disallowed. Assert packages are disallowed; the go-cmp package is the only external package helper allowed. Tests that use external resources or generate test fixtures should be annotated according to the integration package.","breadcrumbs":"Contributors » Tests » Tests","id":"88","title":"Tests"},"89":{"body":"Tests using the integration package cache generated and downloaded assets into a directory named clair-testing inside the directory reported by os.UserCacheDir . For example, on a Linux system, the cache directory will be (in sh notation) ${XDG_CACHE_HOME-$HOME/.cache}/clair-testing.","breadcrumbs":"Contributors » Tests » Caching","id":"89","title":"Caching"},"9":{"body":"Libvuln is the Go package responsible for keeping the database of vulnerabilities consistent, matching container image contents with vulnerabilities, and reporting diffs between updates of the same security database.","breadcrumbs":"Getting Started » Libvuln Usage » Libvuln Usage","id":"9","title":"Libvuln Usage"},"90":{"body":"Claircore endeavors to declare a go version in the go.mod directive that is the minimum required for all the language features to work as expected. The go version will also be updated if there is deemed to be a security fix that could directly affect claircore's codebase.","breadcrumbs":"Contributors » Go Version » Go Version","id":"90","title":"Go Version"}},"length":91,"save":true},"fields":["title","body","breadcrumbs"],"index":{"body":{"root":{"0":{".":{"0":{"df":2,"docs":{"34":{"tf":1.0},"35":{"tf":1.0}}},"1":{"df":1,"docs":{"34":{"tf":1.0}}},"df":0,"docs":{}},"df":1,"docs":{"55":{"tf":2.0}}},"1":{"0":{".":{"0":{"df":2,"docs":{"34":{"tf":1.0},"35":{"tf":1.0}}},"df":0,"docs":{}},"df":0,"docs":{}},"df":3,"docs":{"19":{"tf":4.0},"67":{"tf":1.0},"76":{"tf":1.0}}},"2":{".":{"a":{"df":0,"docs":{},"m":{"a":{"df":0,"docs":{},"z":{"df":0,"docs":{},"o":{"df":0,"docs":{},"n":{"a":{"df":0,"docs":{},"w":{"df":0,"docs":{},"s":{".":{"c":{"df":0,"docs":{},"o":{"df":0,"docs":{},"m":{"/":{"2":{"0":{"1":{"8":{".":{"0":{"3":{"/":{"df":0,"docs":{},"u":{"df":0,"docs":{},"p":{"d":{"a":{"df":0,"docs":{},"t":{"df":0,"docs":{},"e":{"df":0,"docs":{},"s":{"/":{"df":0,"docs":{},"x":{"8":{"6":{"_":{"6":{"4":{"/":{"df":0,"docs":{},"m":{"df":0,"docs":{},"i":{"df":0,"docs":{},"r":{"df":0,"docs":{},"r":{"df":0,"docs":{},"o":{"df":0,"docs":{},"r":{".":{"df":0,"docs":{},"l":{"df":0,"docs":{},"i":{"df":0,"docs":{},"s":{"df":0,"docs":{},"t":{"df":1,"docs":{"37":{"tf":1.0}}}}}}},"df":0,"docs":{}}}}}}}},"df":0,"docs":{}},"df":0,"docs":{}},"df":0,"docs":{}},"df":0,"docs":{}},"df":0,"docs":{}},"df":0,"docs":{}}},"df":0,"docs":{}}}}},"df":0,"docs":{}},"df":0,"docs":{}}}},"df":0,"docs":{}},"df":0,"docs":{}},"df":0,"docs":{}},"df":0,"do